Send_Char PROC NEAR

	                                  mov                   dx , 3FDH                                                                	; Line Status Register
	redo:                            In                    al , dx                                                                  	;Read Line Status
	                                  test                  al , 00100000b
	                                  JZ                    redo                                                                    	;Not empty
	;If empty put the VALUE in Transmit data register
	                                  mov                   dx , 3F8H                                                                	; Transmit data register
	                                  mov                   al,Char_Sent
	                                  out                   dx , al

	return22:                         
	                                  RET
Send_Char ENDP

	;__________________________________________________________________
	;______________________________PROC BREAK__________________________
	;__________________________________________________________________

Force_Receive_Char PROC NEAR
	                                  mov                   Char_Received , -1
	                                  mov                   dx , 3FDH                                                                	; Line Status Register
	RETURN112:                        in                    al , dx
	                                  test                  al , 1
	                                  JZ                    RETURN112                                                                	;Not Ready
	;If Ready read the VALUE in Receive data register
	                                  mov                   dx , 03F8H
	                                  in                    al , dx
	                                  mov                   Char_Received , al

	                                  RET
Force_Receive_Char ENDP

	;__________________________________________________________________
	;______________________________PROC BREAK__________________________
	;__________________________________________________________________

Receive_Char PROC NEAR
	                                  mov                   Char_Received , -1
	                                  mov                   dx , 3FDH                                                                	; Line Status Register
	                                  in                    al , dx
	                                  test                  al , 1
	                                  JZ                    RETURN11                                                                 	;Not Ready
	;If Ready read the VALUE in Receive data register
	                                  mov                   dx , 03F8H
	                                  in                    al , dx
	                                  mov                   Char_Received , al
	RETURN11:                         
	                                  RET
Receive_Char ENDP

	;__________________________________________________________________
	;______________________________PROC BREAK__________________________
	;__________________________________________________________________

ConfigureCommunication PROC NEAR
	                                  mov                   dx,3fbh                                                                  	; Line Control Register
	                                  mov                   al,10000000b                                                             	;Set Divisor Latch Access Bit
	                                  out                   dx,al                                                                    	;Out it

	                                  mov                   dx,3f8h
	                                  mov                   al,01h
	                                  out                   dx,al

	                                  mov                   dx,3f9h
	                                  mov                   al,00h
	                                  out                   dx,al

	                                  mov                   dx,3fbh
	                                  mov                   al,00011011b
	                                  out                   dx,al

                                    
	                                  RET
ConfigureCommunication ENDP



