FETCH_DEST PROC NEAR

    SEARCH_ON_STRING COMMAND_BUFFER_INSTRUCTION,',',12
    JNE SEARCH_2
    MOV AL,12
    SUB AL,CL
    SUB AL,5
    MOV DEST_SIZE,AL 
    JMP FETCH
    
    SEARCH_2:
    SEARCH_ON_STRING COMMAND_BUFFER_INSTRUCTION,'$',12
    MOV AL,12
    SUB AL,CL
    SUB AL,6
    MOV DEST_SIZE,AL
    ;JNE EXIT_FETCH
        
    FETCH:
    MOV SI,OFFSET COMMAND_BUFFER_INSTRUCTION+4
    MOV DI,OFFSET DEST
    MOV CX,0 
    MOV CL,DEST_SIZE
    REP MOVSB
    
    EXIT_FETCH: 
    RET

FETCH_DEST ENDP

FETCH_SOURCE PROC NEAR
    
    
    SEARCH_ON_STRING COMMAND_BUFFER_INSTRUCTION,',',12
    JNE EXIT_FETCH_SOURCE
    
    MOV DI,OFFSET COMMAND_BUFFER_INSTRUCTION
    MOV CX,19
    MOV AL,'$'
    REPNE SCASB
    INC CL
    MOV AL,19
    SUB AL,CL
    MOV DL,6
    ADD DL,DEST_SIZE
    SUB AL,DL
    MOV SOURCE_SIZE,AL
     
    MOV BL,0
    MOV BL,5
    ADD BL,DEST_SIZE
    MOV BYTE PTR GO,BL
    
    MOV SI,OFFSET COMMAND_BUFFER_INSTRUCTION
    ADD SI,GO 

    MOV DI,OFFSET SOURCE
    MOV CX,0 
    MOV CL,SOURCE_SIZE
    REP MOVSB
     
    EXIT_FETCH_SOURCE: 
    RET
    

FETCH_SOURCE ENDP


DECODE_DEST PROC NEAR

    IS_REG_ADDRESSING_MODE:

        SEARCH_ON_STRING DEST,'[',1
        JE IS_REG_INDIRECT

        ITS_2BYTE_DEST:

            MOV DEST_BYTES,2

            COMPARE_STRINGS DEST,IS_AX,2
            JE IT_AX

            COMPARE_STRINGS DEST,IS_BX,2
            JE IT_BX

            COMPARE_STRINGS DEST,IS_CX,2
            JE IT_CX

            COMPARE_STRINGS DEST,IS_DX,2
            JE IT_DX

            COMPARE_STRINGS DEST,IS_SI,2
            JE IT_SI

            COMPARE_STRINGS DEST,IS_DI,2
            JE IT_DI

            COMPARE_STRINGS DEST,IS_SP,2
            JE IT_SP

            COMPARE_STRINGS DEST,IS_BP,2
            JE IT_BP
            JMP ITS_NOT_2BYTE_DEST


            IT_AX:
                MOV DEST_CODE,0
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_BX:
                MOV DEST_CODE,2
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_CX:
                MOV DEST_CODE,4
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DX:  
                MOV DEST_CODE,6
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_SI:  
                MOV DEST_CODE,8
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DI:  
                MOV DEST_CODE,10
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_SP:  
                MOV DEST_CODE,12
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_BP:  
                MOV DEST_CODE,14
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
        
        ITS_NOT_2BYTE_DEST:

            MOV DEST_BYTES,1

            COMPARE_STRINGS DEST,IS_AL,2
            JE IT_AL

            COMPARE_STRINGS DEST,IS_AH,2
            JE IT_AH

            COMPARE_STRINGS DEST,IS_BL,2
            JE IT_BL

            COMPARE_STRINGS DEST,IS_BH,2
            JE IT_BH

            COMPARE_STRINGS DEST,IS_CL,2
            JE IT_CL

            COMPARE_STRINGS DEST,IS_CH,2
            JE IT_CH

            COMPARE_STRINGS DEST,IS_DL,2
            JE IT_DL

            COMPARE_STRINGS DEST,IS_DH,2
            JE IT_DH
            JMP EXIT_GET_DEST

            IT_AL:
                MOV DEST_CODE,0
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_AH:
                MOV DEST_CODE,1
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST

            IT_BL:
                MOV DEST_CODE,2
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_BH:
                MOV DEST_CODE,3
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_CL:
                MOV DEST_CODE,4
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_CH:  
                MOV DEST_CODE,5
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DL:  
                MOV DEST_CODE,6
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST
            IT_DH:  
                MOV DEST_CODE,7
                MOV ADDRESSING_MODE_DEST_TYPE,0
                JMP EXIT_GET_DEST 
    
    IS_REG_INDIRECT:
        
        CMP SOURCE_SIZE,4
        JNE EXIT_GET_DEST

        COMPARE_STRINGS DEST,_IS_BX_,4
        JE IT_BX_

        COMPARE_STRINGS DEST,_IS_SI_,4
        JE IT_SI_

        COMPARE_STRINGS DEST,_IS_DI_,4
        JE IT_DI_
        JMP EXIT_GET_DEST

        IT_BX_: 
            MOV DEST_CODE,2
            MOV ADDRESSING_MODE_DEST_TYPE,1
            JMP EXIT_GET_DEST
        IT_SI_:  
            MOV DEST_CODE,8
            MOV ADDRESSING_MODE_DEST_TYPE,1
            JMP EXIT_GET_DEST
        IT_DI_:  
            MOV DEST_CODE,10
            MOV ADDRESSING_MODE_DEST_TYPE,1
            JMP EXIT_GET_DEST
    EXIT_GET_DEST:
        RET

DECODE_DEST ENDP

DECODE_SOURCE PROC NEAR

    CMP SOURCE_SIZE,0
    JE  EXIT_GET_SOURCE 

    IS_REG_ADDRESSING_MODE_SOURCE:

        SEARCH_ON_STRING DEST,'[',1
        JE IS_DIRECT_SOURCE


        ITS_2BYTE_SOURCE: 
        
            MOV ADDRESSING_MODE_SOURCE_TYPE,0

            MOV SOURCE_BYTES,2

            COMPARE_STRINGS SOURCE,IS_AX,2
            JE IT_AX_S

            COMPARE_STRINGS SOURCE,IS_BX,2
            JE IT_BX_S

            COMPARE_STRINGS SOURCE,IS_CX,2
            JE IT_CX_S

            COMPARE_STRINGS SOURCE,IS_DX,2
            JE IT_DX_S

            COMPARE_STRINGS SOURCE,IS_SI,2
            JE IT_SI_S

            COMPARE_STRINGS SOURCE,IS_DI,2
            JE IT_DI_S

            COMPARE_STRINGS SOURCE,IS_SP,2
            JE IT_SP_S

            COMPARE_STRINGS SOURCE,IS_BP,2
            JE IT_BP_S
            JMP ITS_NOT_2BYTE_SOURCE


            IT_AX_S:
                MOV SOURCE_CODE,0
                JMP EXIT_GET_SOURCE
            IT_BX_S:
                MOV SOURCE_CODE,2
                JMP EXIT_GET_SOURCE
            IT_CX_S:
                MOV SOURCE_CODE,4
                JMP EXIT_GET_SOURCE
            IT_DX_S:  
                MOV SOURCE_CODE,6
                JMP EXIT_GET_SOURCE
            IT_SI_S:  
                MOV SOURCE_CODE,8
                JMP EXIT_GET_SOURCE
            IT_DI_S:  
                MOV SOURCE_CODE,10
                JMP EXIT_GET_SOURCE
            IT_SP_S:  
                MOV SOURCE_CODE,12
                JMP EXIT_GET_SOURCE
            IT_BP_S:  
                MOV SOURCE_CODE,14
                JMP EXIT_GET_SOURCE
        
        ITS_NOT_2BYTE_SOURCE:

            MOV SOURCE_BYTES,1

            COMPARE_STRINGS SOURCE,IS_AL,2
            JE IT_AL_S

            COMPARE_STRINGS SOURCE,IS_AH,2
            JE IT_AH_S

            COMPARE_STRINGS SOURCE,IS_BL,2
            JE IT_BL_S

            COMPARE_STRINGS SOURCE,IS_BH,2
            JE IT_BH_S

            COMPARE_STRINGS SOURCE,IS_CL,2
            JE IT_CL_S

            COMPARE_STRINGS SOURCE,IS_CH,2
            JE IT_CH_S

            COMPARE_STRINGS SOURCE,IS_DL,2
            JE IT_DL_S

            COMPARE_STRINGS SOURCE,IS_DH,2
            JE IT_DH_S
            JMP ITS_NOT_1BYTE_SOURCE

            IT_AL_S:
                MOV SOURCE_CODE,0
                JMP EXIT_GET_SOURCE
            IT_AH_S:
                MOV SOURCE_CODE,1
                JMP EXIT_GET_SOURCE

            IT_BL_S:
                MOV SOURCE_CODE,2
                JMP EXIT_GET_SOURCE
            IT_BH_S:
                MOV SOURCE_CODE,3
                JMP EXIT_GET_SOURCE
            IT_CL_S:
                MOV SOURCE_CODE,4
                JMP EXIT_GET_SOURCE
            IT_CH_S:  
                MOV SOURCE_CODE,5
                JMP EXIT_GET_SOURCE
            IT_DL_S:  
                MOV SOURCE_CODE,6
                JMP EXIT_GET_SOURCE
            IT_DH_S:  
                MOV SOURCE_CODE,7
                JMP EXIT_GET_SOURCE

            ITS_NOT_1BYTE_SOURCE:

            ; MOV SOURCE_CODE,25
            ; ASCII_HEX SOURCE,SOURCE_SIZE,SOURCE_HEX_VALUE

    IS_DIRECT_SOURCE:
        
        MOV ADDRESSING_MODE_SOURCE_TYPE,1

        CMP SOURCE_SIZE,3
        JNZ IS_REG_INDIRECT_SOURCE

        COMPARE_STRINGS SOURCE,_IS_0_,3
        JE _IS_0__

        COMPARE_STRINGS SOURCE,_IS_1_,3
        JE _IS_1__

        COMPARE_STRINGS SOURCE,_IS_2_,3
        JE IT_2__

        COMPARE_STRINGS SOURCE,_IS_3_,3
        JE IT_3__

        COMPARE_STRINGS SOURCE,_IS_4_,3
        JE _IS_4__

        COMPARE_STRINGS SOURCE,_IS_5_,3
        JE IT_5__

        COMPARE_STRINGS SOURCE,_IS_6_,3
        JE IT_6__

        COMPARE_STRINGS SOURCE,_IS_7_,3
        JE _IS_7__

        COMPARE_STRINGS SOURCE,_IS_8_,3
        JE IT_8__

        COMPARE_STRINGS SOURCE,_IS_9_,3
        JE IT_9__

        COMPARE_STRINGS SOURCE,_IS_A_,3
        JE _IS_A__

        COMPARE_STRINGS SOURCE,_IS_B_,3
        JE IT_B__

        COMPARE_STRINGS SOURCE,_IS_C_,3
        JE IT_C__


        COMPARE_STRINGS SOURCE,_IS_D_,3
        JE _IS_D__

        COMPARE_STRINGS SOURCE,_IS_E_,3
        JE IT_E__

        COMPARE_STRINGS SOURCE,_IS_F_,3
        JE IT_F__
        JMP EXIT_GET_SOURCE

        _IS_0__: 
            MOV SOURCE_CODE,16
            JMP EXIT_GET_SOURCE

        _IS_1__: 
            MOV SOURCE_CODE,17
            JMP EXIT_GET_SOURCE
        IT_2__:  
            MOV SOURCE_CODE,18
            JMP EXIT_GET_SOURCE
        IT_3__:  
            MOV SOURCE_CODE,19
            JMP EXIT_GET_SOURCE
        _IS_4__: 
            MOV SOURCE_CODE,20
            JMP EXIT_GET_SOURCE
        IT_5__:  
            MOV SOURCE_CODE,21
            JMP EXIT_GET_SOURCE
        IT_6__:  
            MOV SOURCE_CODE,22
            JMP EXIT_GET_SOURCE
        _IS_7__: 
            MOV SOURCE_CODE,23
            JMP EXIT_GET_SOURCE
        IT_8__:  
            MOV SOURCE_CODE,24
            JMP EXIT_GET_SOURCE
        IT_9__:  
            MOV SOURCE_CODE,25
            JMP EXIT_GET_SOURCE
        _IS_A__: 
            MOV SOURCE_CODE,26
            JMP EXIT_GET_SOURCE
        IT_B__:  
            MOV SOURCE_CODE,27
            JMP EXIT_GET_SOURCE
        IT_C__:  
            MOV SOURCE_CODE,28
            JMP EXIT_GET_SOURCE
        _IS_D__: 
            MOV SOURCE_CODE,29
            JMP EXIT_GET_SOURCE
        IT_E__:  
            MOV SOURCE_CODE,30
            JMP EXIT_GET_SOURCE
        IT_F__:  
            MOV SOURCE_CODE,31
            JMP EXIT_GET_SOURCE

    IS_REG_INDIRECT_SOURCE:
        
        MOV ADDRESSING_MODE_SOURCE_TYPE,2

        ; CMP DEST_SIZE,4
        ; JNZ EXIT_GET_SOURCE

        COMPARE_STRINGS SOURCE,_IS_BX_,4
        JE IT_BX__S

        COMPARE_STRINGS SOURCE,_IS_SI_,4
        JE IT_SI__S

        COMPARE_STRINGS SOURCE,_IS_DI_,4
        JE IT_DI__S
        JMP IS_IMMEDIATE

        IT_BX__S: 
            MOV SOURCE_CODE,2
            JMP EXIT_GET_SOURCE
        IT_SI__S:  
            MOV SOURCE_CODE,8
            JMP EXIT_GET_SOURCE
        IT_DI__S:  
            MOV SOURCE_CODE,10
            JMP EXIT_GET_SOURCE

    IS_IMMEDIATE:  
        MOV ADDRESSING_MODE_SOURCE_TYPE,3

        MOV SOURCE_CODE,25
        ASCII_HEX SOURCE,SOURCE_SIZE,SOURCE_HEX_VALUE

    EXIT_GET_SOURCE:
        RET

DECODE_SOURCE ENDP


GET_ADDRESSING_MODE_ALI PROC NEAR
    
    CMP ADDRESSING_MODE_DEST_TYPE,0
    JNE IT_DEST_REG_INDIRECT

        GET_DEST_ADDRESS_0 ALI_AX

        CMP ADDRESSING_MODE_SOURCE_TYPE,0
        JNE IT_SOURCE_DIRECT

            GET_SOURCE_ADDRESS_0 ALI_AX
            JMP EXIT_GET_ADDRESSING_MODE

        IT_SOURCE_DIRECT:

            CMP ADDRESSING_MODE_SOURCE_TYPE,1
            JNE IT_SOURCE_INDIRECT

            GET_SOURCE_ADDRESS_1 ALI_AX
            JMP EXIT_GET_ADDRESSING_MODE

        IT_SOURCE_INDIRECT:

            CMP ADDRESSING_MODE_SOURCE_TYPE,2
            JNE IT_SOURCE_IMMEDIATE

            GET_SOURCE_ADDRESS_2 ALI_AX
            JMP EXIT_GET_ADDRESSING_MODE

        IT_SOURCE_IMMEDIATE:

            CMP ADDRESSING_MODE_SOURCE_TYPE,3
            
            GET_SOURCE_ADDRESS_3
            JMP EXIT_GET_ADDRESSING_MODE

 


        JMP EXIT_GET_ADDRESSING_MODE

    IT_DEST_REG_INDIRECT:

    CMP ADDRESSING_MODE_DEST_TYPE,1
    JNE EXIT_GET_ADDRESSING_MODE

        GET_DEST_ADDRESS_1 AHMED_AX

        CMP ADDRESSING_MODE_SOURCE_TYPE,0
        JNE IT_SOURCE_IMMEDIATE_2

            GET_SOURCE_ADDRESS_0 ALI_AX
            JMP EXIT_GET_ADDRESSING_MODE
        
        IT_SOURCE_IMMEDIATE_2:

            CMP ADDRESSING_MODE_SOURCE_TYPE,3
            JMP EXIT_GET_ADDRESSING_MODE

            GET_SOURCE_ADDRESS_3 
            JMP EXIT_GET_ADDRESSING_MODE

    EXIT_GET_ADDRESSING_MODE:
    GET_CARRY_ADDRESS ALI_AX

    RET
GET_ADDRESSING_MODE_ALI ENDP

GET_ADDRESSING_MODE_AHMED PROC NEAR
    
    CMP ADDRESSING_MODE_DEST_TYPE,0
    JNE IT_DEST_REG_INDIRECT_AHMED

        GET_DEST_ADDRESS_0 AHMED_AX

        CMP ADDRESSING_MODE_SOURCE_TYPE,0
