    OPERATION_8BITS_ROR:

        MOV DI,DEST_ADDRESS
        MOV SI,SOURCE_ADDRESS
        MOV AL,[DI]
        MOV CL,[SI]
        ROR AL,CL
        MOV [DI],AL

        JNC CLEAR_CARRY_ROR_2
            
            MOV AX,1
            MOV [BX],AL
            JMP EXIT_ROR_OP

        CLEAR_CARRY_ROR_2:

            MOV AX,0
            MOV [BX],AL
            
        JMP EXIT_ROR_OP

    EXIT_ROR_OP:

    RET
ROR_OP  ENDP


INC_OP PROC NEAR

    CMP DEST_BYTES,1
    JE OPERATION_8BITS_INC

        MOV DI,DEST_ADDRESS
        MOV AX,[DI]
        INC AX
        MOV [DI],AX
        JMP EXIT_INC_OP

    OPERATION_8BITS_INC:

        MOV DI,DEST_ADDRESS
        MOV AL,[DI]    
        INC AL
        MOV [DI],AL

    EXIT_INC_OP:
    RET

INC_OP ENDP

DEC_OP PROC NEAR

    CMP DEST_BYTES,1
    JE OPERATION_8BITS_DEC

        MOV DI,DEST_ADDRESS
        MOV AX,[DI]
        INC AX
        MOV [DI],AX
        JMP EXIT_DEC_OP

    OPERATION_8BITS_DEC:

        MOV DI,DEST_ADDRESS
        MOV AL,[DI]    
        INC AL
        MOV [DI],AL

    EXIT_DEC_OP:
    RET
DEC_OP ENDP


MOV_OP  PROC NEAR


    CMP DEST_BYTES,1
    JE OPERATION_8BITS_MOV

        MOV BX,CARRY_ADDRESS
        MOV DI,DEST_ADDRESS
        MOV SI,SOURCE_ADDRESS
        MOV AX,[DI]
        MOV BX,[SI]
        MOV AX,BX
        MOV [DI],AX
        JMP EXIT_MOV_OP

    OPERATION_8BITS_MOV:

        MOV DI,DEST_ADDRESS
        MOV SI,SOURCE_ADDRESS
        MOV AL,[DI]
        MOV BL,[SI]
        MOV AL,BL
        MOV [DI],AL

    EXIT_MOV_OP:

    RET

MOV_OP ENDP


