SHOOTING PROC NEAR
                                                                        
    main_loop:                                 ;update logic and display everything
                                            ;check any key is pressed
        mov ah,1h
        int 16h                                ;go if pressed
        jnz key_pressed
        jmp inside_loop                        ;or just continue
        
        inside_loop:                           ;checking every thing
            
            cmp miss1,3                          ;if baloon miss 3 times.go to game over section
            jge game_over

            cmp miss2,3
            jge game_over
            
            mov dx,arrow1_pos                   ;checking collitions
            cmp dx, loon1_pos
            je hit1

            mov dx,arrow2_pos                   ;checking collitions
            cmp dx, loon2_pos
            je hit2
            
            cmp direction1,8d                   ;update player position
            je player1_up
            cmp direction1,2d                   ;up or down based on direction1 veriable
            je player1_down
            cmp direction2,8d
            je player2_up
            cmp direction2,2d
            je player2_down
            
            mov dx,arrow2_limit                 ;hide arrow 
            cmp arrow2_pos, dx
            jge hide_arrow2
            
            mov dx,arrow1_limit                 ;hide arrow 
            cmp arrow1_pos, dx
            jge hide_arrow1

            
            
            cmp loon1_pos, 0d                   ;check missed loon
            jle miss_loons
            cmp loon2_pos, 0d
            jle miss_loons
            jne render_loons
        
            hit1:                               ;play sound if hit
                mov loon1_status, 0d
                mov ah,2
                mov dx, 7d
                int 21h 
                
                inc hits1                       ;update score
                
                
                mov ah,2                       ;new line
                mov dl, 0dh
                int 21h    
                
                cmp loon2_status, 0d
                je fire_loons                  ;new loon pops up
                jmp render_loons

            hit2:                               ;play sound if hit
                mov loon2_status, 0d
                mov ah,2
                mov dx, 7d
                int 21h 
                
                inc hits2                       ;update score
                
    
                
                mov ah,2                       ;new line
                mov dl, 0dh
                int 21h    
                
                cmp loon1_status, 0d
                je fire_loons                  ;new loon pops up
                jmp render_loons

            render_loons:                       ;draw loons
                mov cl, ' '                    ;hide old loon
                mov ch, 1111b

                
                MOV     CX, 1H
                MOV     DX, 140H
                MOV     AH, 86H         
                INT     15H                 ;wait 1 sec
                
                cmp loon1_status, 0d
                je render_loon2

                mov bx,loon1_pos 
                mov es:[bx], cx
                    
                sub loon1_pos,160d              ;and draw new one in new position
                mov cl, 15d
                mov ch, 1101b

                mov bx,loon1_pos 
                mov es:[bx], cx

                render_loon2:
                    mov cl, ' '                     ;hide old loon
                    mov ch, 1111b
                    
                    cmp loon2_status, 0d
                    je firing_check


                    mov bx,loon2_pos 
                    mov es:[bx], cx
                        
                    sub loon2_pos,160d              ;and draw new one in new position
                    mov cl, 15d
                    mov ch, 1101b

                    mov bx,loon2_pos 
                    mov es:[bx], cx
                    
                firing_check:
                    cmp loon1_status, 0d
                    jne continue
                    cmp loon2_status, 0d
                    jne continue
                    jmp fire_loons

                continue:
                    cmp arrow1_status,1d    
                    je render_arrows
                    cmp arrow2_status,1d
                    je render_arrow2

                    jmp inside_loop2 

            render_arrows:                      ;render arrow
            
                mov cl, ' '
                mov ch, 1111b
            
                cmp arrow1_status, 0d
                je render_arrow2
                
                mov bx,arrow1_pos               ;hide old position
                mov es:[bx], cx
                    
                add arrow1_pos,4d               ;draw new position
                mov cl, 26d
                mov ch, 1001b
            
                mov bx,arrow1_pos 
                mov es:[bx], cx

                render_arrow2:
                    mov cl, ' '
                    mov ch, 1111b
                
                    cmp arrow2_status, 0d
                    je inside_loop2
                    
                    mov bx,arrow2_pos               ;hide old position
                    mov es:[bx], cx
                        
                    add arrow2_pos,4d               ;draw new position
                    mov cl, 26d
                    mov ch, 1001b
                
                    mov bx,arrow2_pos 
                    mov es:[bx], cx

            
            inside_loop2:
                
                mov cl, 125d                  ;draw player char
                mov ch, 1100b                 ;color red
                
                mov bx,player1_pos 
                mov es:[bx], cx

                mov cl, 125d
                mov ch,1010b

                mov bx,player2_pos
                mov es:[bx], cx
                
                
                        
        cmp exit,0
        je main_loop                          ;end main loop
        jmp exit_game
    
    jmp inside_loop2
        
    player1_up:                                ;hide player old position
        mov cl, ' '
        mov ch, 1111b
            
        mov bx,player1_pos 
        mov es:[bx], cx
        
        sub player1_pos, 160d                  ;set new postion of player
        mov direction1, 0    

        jmp inside_loop2                      ;it will draw in main loop
        
    player1_down:
        mov cl, ' '                           ;same as player up
        mov ch, 1111b                         ;hide old one and set new postion
                                            
        mov bx,player1_pos 
        mov es:[bx], cx
        
        add player1_pos,160d                   ;and main loop draw that
        mov direction1, 0
        
        jmp inside_loop2

    player2_up:                                ;hide player old position
        mov cl, ' '
        mov ch, 1111b
            
        mov bx,player2_pos 
        mov es:[bx], cx
        
        sub player2_pos, 160d                  ;set new postion of player
        mov direction2, 0    

        jmp inside_loop2                      ;it will draw in main loop
        
    player2_down:
        mov cl, ' '                           ;same as player up
        mov ch, 1111b                         ;hide old one and set new postion
                                            
        mov bx,player2_pos 
        mov es:[bx], cx
        
        add player2_pos,160d                   ;and main loop draw that
        mov direction2, 0
        
        jmp inside_loop2
    key_pressed:                              ;input hanaling section
        mov ah,0
        int 16h

        cmp ah,48h                            ;go upKey if up button is pressed
        je upKey
        cmp ah, 50h
        je downKey
        
        cmp ah,39h                            ;go spaceKey if up button is pressed
        je spaceKey
        
        cmp ah,4Bh                            ;go leftKey (this is for debuging)
        je leftKey

        cmp ah,11h
        je wKey

        cmp ah,1Fh
        je sKey

        cmp ah,22h
        je gKey
        
                                            ;if no key is pressed go to inside of loop
        jmp inside_loop

    leftKey:                                  ;for debuging 
        ;jmp game_over
        inc miss1
                

        
        mov ah,2
        mov dl, 0dh
        int 21h
    jmp inside_loop
        
    upKey:                                    ;set player1 direction to up
        mov direction1, 8d
        jmp inside_loop

    downKey:
        mov direction1, 2d                     ;set player1 direction to down
        jmp inside_loop
        
    spaceKey:                                 ;shoot an arrow
        cmp arrow1_status,0
        je  fire_arrow1
        jmp inside_loop

    wKey:                                    ;set player2 direction to up
        mov direction2, 8d
        jmp inside_loop

    sKey:
        mov direction2, 2d                     ;set player2 direction to down
        jmp inside_loop
        
    gKey:                                 ;shoot an arrow
        cmp arrow2_status,0
        je  fire_arrow2
        jmp inside_loop


    fire_arrow1:                               ;set arrow postion in player position
        mov dx, player1_pos                    ;so arrow fire from player postion
        mov arrow1_pos, dx
        
        mov dx,player1_pos                     ;when fire an arrow it also set limit
        mov arrow1_limit, dx                   ;of arrow. where it should be hide
        add arrow1_limit, 22d  ;150
        
        mov arrow1_status, 1d                  ;set arrow status.It prevents multiple 
        jmp inside_loop                       ;shooting 

    fire_arrow2:                               ;set arrow postion in player position
        mov dx, player2_pos                    ;so arrow fire from player postion
        mov arrow2_pos, dx
        
        mov dx,player2_pos                     ;when fire an arrow it also set limit
        mov arrow2_limit, dx                   ;of arrow. where it should be hide
        add arrow2_limit, 22d  ;150
        
        mov arrow2_status, 1d                  ;set arrow status.It prevents multiple 
        jmp inside_loop                       ;shooting 

    miss_loons:
        
        cmp loon1_pos, 0d                   ;check missed loon
        jg miss_loon2

        miss_loon1:
            mov loon1_status, 0d
            inc miss1
            
        
        miss_loon2:
            cmp loon2_pos, 0d
            jg render_loons

            mov loon2_status, 0d
            inc miss2

                                                ;new line
            mov ah,2
            mov dl, 0dh
            int 21h 

        jmp render_loons
        
    fire_loons:                                ;fire new balloons

        fire1:
            mov loon1_status, 1d
            mov loon1_pos, 3860d     ;3860d    

        fire2:
            mov loon2_status, 1d
            mov loon2_pos, 3810d     ;3810d

        jmp render_loons
        
    hide_arrow1:
        mov arrow1_status, 0                   ;hide arrow
        
        mov cl, ' '
        mov ch, 1111b
        
        mov bx,arrow1_pos 
        mov es:[bx], cx
        
        cmp loon1_pos, 0d 
        jle miss_loons
        jne render_loons 
        
        jmp inside_loop2
        
                                            ;print game over screen

    hide_arrow2:
        mov arrow2_status, 0                   ;hide arrow
        
        mov cl, ' '
        mov ch, 1111b
        
        mov bx,arrow2_pos 
        mov es:[bx], cx
        
        cmp loon2_pos, 0d 
        jle miss_loons
        jne render_loons 
        
        jmp inside_loop2

                                            ;print game over screen
    game_over:
        mov ah,09h
        ;mov dh,0
        mov dx, offset game_over_str
        int 21h
        
        
        
        mov cl, ' '                           ;hide last of screen balloon
        mov ch, 1111b 
        mov bx,arrow1_pos                      
        
        mov cl, ' '                           ;hide player
        mov ch, 1111b 
        mov bx,player1_pos  
    
        
        ;reset value                          ;update variable for start again
        mov miss1, 0d
        mov hits1,0d
        
        mov player1_pos, 1760d

        mov arrow1_pos, 0d
        mov arrow1_status, 0d 
        mov arrow1_limit, 22d      

        mov loon1_pos, 3860d       
        mov loon1_status, 1d
            
        mov direction1, 0d

        mov miss2, 0d
        mov hits2,0d
        
        mov player2_pos, 1710d

        mov arrow2_pos, 0d
        mov arrow2_status, 0d 
        mov arrow2_limit, 22d      

        mov loon2_pos, 3810d       
        mov loon2_status, 1d
            
        mov direction2, 0d
        
                                            ;wait for input
        input:
            mov ah,1
            int 21h
            cmp al,13d
            jne input

            mov ah,0
             mov al,3
            int 10h        
            ret  ; clear screen
            jmp main_loop
        

    game_menu:
                                            ;game menu screen
        mov ah,09h
        mov dh,0
        mov dx, offset game_start_str
        int 21h

        MOV     CX, 015H
        MOV     DX, 8240H
        MOV     AH, 86H         
        INT     15H        ;wait 1 sec

        mov ah,0
        mov al,3
        int 10h        
        ret   ; clear_screen
        

        
        jmp main_loop

    exit_game:                                  ;end of our sweet game :)
    mov exit,10d
    RET
SHOOTING ENDP

