	                                  jne                   s_havent_reach_the_pageend


	                                  mov                   ax,0601h
	                                  mov                   bh,sendind_colors
	                                  mov                   cx,0                                                                     	;from cl,ch
	                                  mov                   dx,0b4FH                                                                 	;to dl,dh
	                                  int                   10h
	                                  dec                   counter_y1


