	                                  jne                   r_havent_reach_the_pageend

	                                  mov                   ax,0601h
	                                  mov                   bh,recieving_colors
	                                  mov                   cx,0d00H                                                                 	;from cl,ch
	                                  mov                   dx,184FH                                                                 	;to dl,dh
	                                  int                   10h
