recieve_data proc near
	;if al=0 then there is no input

	                                  mov                   dx,3fdh
	                                  in                    al,dx
	                                  and                   al,00000001b
	                                  jz                    no_in

	                                  mov                   dx,3f8h
	                                  in                    al,dx
	                                  mov                   recieves,al
	                                  jmp                   recieve_goout

	no_in:                            mov                   al,0

	recieve_goout:                    

	                                  ret
recieve_data endp
