send_data proc near

	                                  mov                   dx,3fdh
	again12:                          in                    al,dx
	                                  and                   al,00100000b
	                                  jz                    again12

	                                  mov                   dx,3f8h
	                                  mov                   al,sends
	                                  out                   dx,al


	                                  ret
send_data endp

