handel_backspace_SEND proc near
	;handel sends
	                                  cmp                   counter_x,1
	                                  JE                    the_start_line

	                                  dec                   counter_x
	                                  mov                   sends ,0
	                                  print_mesg            counter_x,counter_y1,1,sends
	                                  dec                   counter_x
	                                  mov                   sends ,8
	                                  jmp                   return_handel_backspace_SEND

	the_start_line:                   
	                                  DEC                   counter_x
	                                  cmp                   counter_y1,0
	                                  je                    return_handel_backspace_SEND
	                                  dec                   counter_y1

	                                  mov                   counter_x,78
	                                  mov                   sends ,0
	                                  print_mesg            counter_x,counter_y1,1,sends
	                                  mov                   sends ,8
	                                  mov                   counter_x,77
	                                  jmp                   return_handel_backspace_SEND

	return_handel_backspace_SEND:     
	                                  ret
handel_backspace_SEND endp

	;__________________________________________________________________
	;______________________________PROC BREAK__________________________
	;__________________________________________________________________

handel_backspace_RECIEVE proc near
	;handel recieve
	                                  cmp                   counter,1
	                                  JE                    the_start_line_rec

	                                  dec                   counter
	                                  mov                   recieves ,0
	                                  print_mesg            counter,counter_y2,1,recieves
	                                  dec                   counter
	                                  mov                   recieves ,8
	                                  jmp                   return_handel_backspace_recieves

	the_start_line_rec:               
	                                  DEC                   counter
	                                  cmp                   counter_y2,13
	                                  je                    return_handel_backspace_recieves
	                                  dec                   counter_y2

	                                  mov                   counter,78
	                                  mov                   recieves ,0
	                                  print_mesg            counter,counter_y2,1,recieves
	                                  mov                   recieves ,8
	                                  mov                   counter,77
	                                  jmp                   return_handel_backspace_recieves

	return_handel_backspace_recieves: 
	                                  ret

handel_backspace_RECIEVE endp

CHAT_SEND PROC near
	;send data
	s_looping:                        
	                                  move_cursor           counter_x,counter_y1
	                                  mov                   ax,0
	                                  mov                   ah,1
	                                  int                   16h
	                                  cmp                   al,0
	                                  je                    no_input
	;clear the buffer
	;ClearBuffer
	                                  call                  clearkeyboardbuffer
	                                  mov                   sends,al
	;--------------------------------checking
	                                  cmp                   sends,13
	                                  je                    send_enter

	                                  cmp                   sends,8
	                                  jne                   not_backspace
	                                  call                  handel_backspace_SEND
	not_backspace:                    


	                                  print_mesg            counter_x,counter_y1,1,sends
	                                  jmp                   conrinue_prog_send
	send_enter:                       
	                                  mov                   counter_x,78
	conrinue_prog_send:               



	                                  call                  send_data
	                                  inc                   counter_x
	                                  mov                   al,counter_x
	                                  cmp                   al,79
	                                  jne                   no_input
	                                  inc                   counter_y1

	                                  call                  check_scroll_up_sending

	                                  mov                   al,1
	                                  mov                   counter_x,al
	no_input:                         
	                                  RET
CHAT_SEND ENDP

	;__________________________________________________________________
	;______________________________PROC BREAK__________________________
	;__________________________________________________________________

CHAT_RECIEVE PROC near
	r_looping:                        
	                                  call                  recieve_data
	;checking the al 0-> no_input , otherwise-> there's an input
	                                  cmp                   al,0
	                                  je                    fakes

	;--------------------checking input for esc or enter(new line) or backspace
	                                  cmp                   recieves,13
	                                  jne                   normal_msg



	                                  mov                   counter,78
	                                  jmp                   conrinue_prog
	normal_msg:                       


	                                  cmp                   recieves,8
	                                  jne                   not_backspace_recieves
	                                  call                  handel_backspace_RECIEVE
	not_backspace_recieves:           





	                                  print_mesg            counter,counter_y2,1,recieves
	conrinue_prog:                    
	                                  inc                   counter
	                                  mov                   al,counter
	                                  cmp                   al,79
	                                  jne                   fakes
	                                  inc                   counter_y2

	                                  call                  check_scroll_up_recieving

	                                  mov                   al,1
	                                  mov                   counter,al
	fakes:                            
	                                  RET
CHAT_RECIEVE ENDP


