HEX_ASCII_PROC PROC NEAR

    MOV CX,4
    LOOP_HEX_ASCII:
        MOV AX,REG_BUFFER
        MOV BX,16

        DIV BX

        MOV REG_BUFFER,AX

        MOV AL,DL
        LEA BX,ASCII_TABLE
        XLAT

        MOV [DI],AL
        DEC DI
        DEC CX
    JNZ LOOP_HEX_ASCII
    MOV REG_BUFFER,0
    RET

HEX_ASCII_PROC ENDP
